script: |
  super -f text -I q5805.spq | sort > q5805.out

inputs:
  - name: q5805.spq
    data: |
      SELECT DISTINCT - 65 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor1, tab2 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q5805.out
    data: |
      -65
